    let val = props.data[i][0];
    refer = refer + val;
  }
  setTotal(refer);
  return (
    <React.Fragment>
      <h1>Products</h1>
      <ul>
        {/* {props.data.map((d) => {
          return (
            <li key={`${d[0]}`}>
              {`${d[0]}-${d[1]} ${d[2]}`}
              <button id={`${d[0]}`}>Delete</button>
            </li>
          );
        })} */}
      </ul>
      <h3>Total Worth Of the Products:{total}</h3>
    </React.Fragment>
  );
};
export default ProductList;
